INSERT INTO `services` (`id`, `name`, `slug`, `image`, `details`, `status`, `sort_index`, `created_at`, `updated_at`, `short_name`, `price`, `unit`) VALUES
(1, 'Gasoline Delivery', 'gasoline-delivery', 'frontend/img/services/s-1.png', '<p>Having gasoline delivered to your home ensures your family vehicles are always fueled and ready for that weekend getaway or unexpected errand.<br />\r\n<br />\r\nDo you need gasoline for your fleet of cars or equipment? EZ Fuel service proudly offers all grades of gasoline &mdash; including regular, midgrade, premium, andGloved hand holding a gas pump, filling up a large truck. non-ethanol (recreational/marine) &mdash; and related service.<br />\r\n<br />\r\nOur service team has helped to get the fuel on their home to reduce hastle and don&#39;t need to go pamp. Backed by a fleet of trained professionals and equipped service vehicles, guaranteed on-site fuel supplies, and supplementary fuel service, we can meet all your gasoline needs. Need dependable gasoline delivery service in your home?</p>', 1, NULL, '2024-02-13 08:47:09', '2024-02-29 14:06:18', 'Gas', 12.4000, 'Gallon'),
(2, 'Diesel Delivery', NULL, 'storage/uploads/image/service/image17091976931329766558.webp', '<p>asds</p>', 1, 0, '2024-02-29 14:08:13', '2024-02-29 14:08:13', 'Diesel', 10.0000, 'Gallon');
